import { Component } from "react";
import DashboardHead from '../../layouts/Dashboard/DashboardHead';
import DashboardBody from '../../layouts/Dashboard/DashboardBody';
import Main from '../../layouts/Dashboard/Main';
import { Router, Route, Link, browserHistory, IndexRoute } from 'react-router';

class HomeView extends Component {
    
    dashboardHome(){
        <div>
            <h1>
                hello dashboard home
            </h1>
        </div>
    }

    dashboardHistory(){
        <div>
            <h1>
                hello dashboard history
            </h1>
        </div>
    }

    render(){
        return(
            <div>
                <DashboardHead title="Dashboard Home"/>
                <DashboardBody >
                    <Main>
                    <div class="content">
                        <div class="container-fluid">
                        <div class="row">
                            <div class="col-lg-3 col-md-6 col-sm-6">

                            <Router history = {browserHistory}>
                                <Route path = "/" component = {HomeView}>
                                    <IndexRoute component = {this.dashboardHome} />
                                    <Route path = "home" component = {this.dashboardHome} />
                                    <Route path = "about" component = {this.dashboardHistory} />
                                </Route>
                            </Router>

                            </div>
                        </div>
                        </div>
                    </div>
                    
                    </Main>
                </DashboardBody>
            </div>
        )
    }

}

export default HomeView;
